import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../contexts/AllContexts';

function Register() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    phoneNumber: '',
    disabilityProfile: {
      hasVisualImpairment: false,
      hasMotorImpairment: false,
      hasCognitiveImpairment: false,
      hasSpeechImpairment: false
    },
    accessibilitySettings: {
      enableVoiceNavigation: true,
      enableScreenReader: false,
      highContrastMode: false,
      fontSize: 'medium',
      enableBiometric: false
    }
  });
  const { register } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleDisabilityChange = (e) => {
    const { name, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      disabilityProfile: {
        ...prev.disabilityProfile,
        [name]: checked
      }
    }));
  };

  const handleAccessibilityChange = (e) => {
    const { name, checked, value, type } = e.target;
    setFormData(prev => ({
      ...prev,
      accessibilitySettings: {
        ...prev.accessibilitySettings,
        [name]: type === 'checkbox' ? checked : value
      }
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const success = await register(formData);
    if (success) navigate('/dashboard');
  };

  return (
    <div style={{ maxWidth: '400px', margin: '50px auto', padding: '20px' }}>
      <h1>Register for Accessible UPI</h1>
      <form onSubmit={handleSubmit}>
        <input
          name="name"
          placeholder="Full Name"
          value={formData.name}
          onChange={handleChange}
          required
          style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
        />
        <input
          name="email"
          type="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          required
          style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
        />
        <input
          name="password"
          type="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          required
          style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
        />
        <input
          name="phoneNumber"
          placeholder="Phone (10 digits)"
          value={formData.phoneNumber}
          onChange={handleChange}
          required
          style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
        />
        <div style={{ marginBottom: '15px' }}>
          <h3>Accessibility Profile</h3>
          <label>
            <input
              type="checkbox"
              name="hasVisualImpairment"
              checked={formData.disabilityProfile.hasVisualImpairment}
              onChange={handleDisabilityChange}
            />
            Visual impairment
          </label>
          <br />
          <label>
            <input
              type="checkbox"
              name="hasMotorImpairment"
              checked={formData.disabilityProfile.hasMotorImpairment}
              onChange={handleDisabilityChange}
            />
            Motor impairment
          </label>
          <br />
          <label>
            <input
              type="checkbox"
              name="hasCognitiveImpairment"
              checked={formData.disabilityProfile.hasCognitiveImpairment}
              onChange={handleDisabilityChange}
            />
            Cognitive impairment
          </label>
          <br />
          <label>
            <input
              type="checkbox"
              name="hasSpeechImpairment"
              checked={formData.disabilityProfile.hasSpeechImpairment}
              onChange={handleDisabilityChange}
            />
            Speech impairment
          </label>
        </div>
        <div style={{ marginBottom: '15px' }}>
          <h3>Preferred Access Settings</h3>
          <label>
            <input
              type="checkbox"
              name="enableVoiceNavigation"
              checked={formData.accessibilitySettings.enableVoiceNavigation}
              onChange={handleAccessibilityChange}
            />
            Enable Voice Navigation
          </label>
          <br />
          <label>
            <input
              type="checkbox"
              name="enableScreenReader"
              checked={formData.accessibilitySettings.enableScreenReader}
              onChange={handleAccessibilityChange}
            />
            Screen Reader Mode
          </label>
          <br />
          <label>
            <input
              type="checkbox"
              name="highContrastMode"
              checked={formData.accessibilitySettings.highContrastMode}
              onChange={handleAccessibilityChange}
            />
            High Contrast
          </label>
          <br />
          <label>
            Font Size:
            <select
              name="fontSize"
              value={formData.accessibilitySettings.fontSize}
              onChange={handleAccessibilityChange}
              style={{ marginLeft: '10px' }}
            >
              <option value="small">Small</option>
              <option value="medium">Medium</option>
              <option value="large">Large</option>
              <option value="extra-large">Extra Large</option>
            </select>
          </label>
        </div>
        <button type="submit" style={{ width: '100%', padding: '12px' }}>
          Register
        </button>
      </form>
      <p style={{ marginTop: '20px' }}>
        Already have an account? <Link to="/login">Login</Link>
      </p>
    </div>
  );
}

export default Register;
